import React from "react";
import Navbar from "./Navbar";

const Home = () => {
  return (
    <>
      <section id="header" className="section">
        <div className="container-fluid nav_bg">
          <div className="row">
            <div className="col-10 mx-auto">

                <div className="col-md-6 pt-5 pt-lg-20 order-2 order-lg-1">
                    <h1>Hire some of the efficients ninjas from <strong>Konoha</strong></h1>
                </div>

            </div>
          </div>
        </div>
        
      </section>
    </>
  );
};
export default Home;
